import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import AppBar from '@mui/material/AppBar';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import Divider from '@mui/material/Divider';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';

const drawerWidth = 240;

export default function ClippedDrawer() {
  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar 
        position="fixed" 
        sx={{ 
          zIndex: (theme) => theme.zIndex.drawer + 1,
          bgcolor: '#FFEB3B', // Amarelo
        }}
      >
        <Toolbar>
          <Typography variant="h6" noWrap component="div">
            Kingstown - Sala de aula
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box', backgroundColor: '#F5F5F5' },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto' }}>
          <List>
            {['Início', 'Configurações', 'Minhas Turmas:'].map((text) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <Typography>{text}</Typography>
                </ListItemButton>
              </ListItem>
            ))}
            {['Turma 01', 'Turma 02'].map((text) => (
              <ListItem key={text} disablePadding>
                <ListItemButton sx={{ pl: 4 }}>
                  <Typography>{text}</Typography>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
        <Toolbar />
        <Grid container spacing={3}>
          {[1, 2, 3, 4, 5, 6].map((_, index) => (
            <Grid item xs={4} key={index}>
              <Paper 
                elevation={3} 
                sx={{ 
                  height: 150, 
                  display: 'flex', 
                  flexDirection: 'column',
                  justifyContent: 'flex-end',
                  backgroundColor: '#E0E0E0'
                }}
              >
                <Box sx={{ bgcolor: '#673AB7', color: 'white', textAlign: 'center', padding: 1 }}>
                  <Typography>Kingstown College</Typography>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
}
